import React, { Component } from 'react';
class Login extends Component {
    render() { 
        return (
            <div>
                <form action="">
                    <label for="username">Username</label><br></br>
                   <input type="text" id="username"  name="username"/>

                </form>
            </div>
        );
    }
}

export default Login;
